import React, { useState, useEffect } from 'react';
import { Container, Card, Table, Button, Modal, Form } from 'react-bootstrap';
import { API_BASE_URL } from '../../App';
import { useAuth } from '../../hooks/useAuth';
import Navbar from '../Common/Navbar';
import PriceModal from './PriceModal';

const AgentDashboard = () => {
    const [properties, setProperties] = useState([]);
    const [loading, setLoading] = useState(true);
    const [showPriceModal, setShowPriceModal] = useState(false);
    const [selectedProperty, setSelectedProperty] = useState(null);
    const { user } = useAuth();

    useEffect(() => {
        fetchAgentProperties();
    }, []);

    const fetchAgentProperties = async () => {
        try {
            const token = localStorage.getItem('agent_token');
            const response = await fetch(`${API_BASE_URL}/agent/properties`, {
                headers: {
                    'Authorization': `Bearer ${token}`,
                    'Content-Type': 'application/json',
                },
            });

            const data = await response.json();
            if (data.success) {
                setProperties(data.data || []);
            }
        } catch (error) {
            console.error('Error fetching agent properties:', error);
        } finally {
            setLoading(false);
        }
    };

    const handlePriceUpdate = (property) => {
        setSelectedProperty(property);
        setShowPriceModal(true);
    };

    const handlePriceSave = async (agentPrice) => {
        if (!selectedProperty || !agentPrice) return;

        try {
            const token = localStorage.getItem('agent_token');
            const response = await fetch(`${API_BASE_URL}/agent/properties/${selectedProperty.id}/price`, {
                method: 'POST',
                headers: {
                    'Authorization': `Bearer ${token}`,
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ agent_price: parseFloat(agentPrice) }),
            });

            const data = await response.json();
            if (data.success) {
                setShowPriceModal(false);
                setSelectedProperty(null);
                fetchAgentProperties(); // Refresh the list
            }
        } catch (error) {
            console.error('Error updating price:', error);
        }
    };

    if (loading) {
        return (
            <>
                <Navbar />
                <Container className="container-custom py-5">
                    <div className="text-center">
                        <div className="spinner-border" role="status">
                            <span className="visually-hidden">Loading...</span>
                        </div>
                    </div>
                </Container>
            </>
        );
    }

    return (
        <>
            <Navbar />
            <Container className="container-custom py-5">
                <div className="d-flex justify-content-between align-items-center mb-4">
                    <h2>Agent Dashboard</h2>
                    <div>
                        <span className="badge bg-success me-2">Welcome, {user?.name}</span>
                        <span className="badge bg-info">
                            {properties.filter(p => p.has_custom_price).length} Properties Priced
                        </span>
                    </div>
                </div>

                <Card className="shadow-sm">
                    <Card.Header>
                        <h5 className="mb-0">Your Property Pricing</h5>
                    </Card.Header>
                    <Card.Body className="p-0">
                        <Table responsive hover className="mb-0">
                            <thead>
                                <tr>
                                    <th>Property</th>
                                    <th>City</th>
                                    <th>Type</th>
                                    <th>Base Price</th>
                                    <th>Your Price</th>
                                    <th>Status</th>
                                    <th>Action</th>
                                </tr>
                            </thead>
                            <tbody>
                                {properties.map(property => (
                                    <tr key={property.id}>
                                        <td>
                                            <div className="d-flex align-items-center">
                                                {property.primary_image && (
                                                    <img 
                                                        src={property.primary_image} 
                                                        alt={property.title}
                                                        style={{ 
                                                            width: '40px', 
                                                            height: '30px', 
                                                            objectFit: 'cover',
                                                            marginRight: '12px'
                                                        }}
                                                    />
                                                )}
                                                <div>
                                                    <strong>{property.title}</strong>
                                                </div>
                                            </div>
                                        </td>
                                        <td>{property.city}</td>
                                        <td>
                                            <span className="badge bg-light text-dark">
                                                {property.property_type}
                                            </span>
                                        </td>
                                        <td>
                                            <strong>${property.base_price}/night</strong>
                                        </td>
                                        <td>
                                            {property.has_custom_price ? (
                                                <span className="badge bg-success">
                                                    ${property.agent_price}/night
                                                </span>
                                            ) : (
                                                <span className="badge bg-secondary">
                                                    Not Set
                                                </span>
                                            )}
                                        </td>
                                        <td>
                                            {property.has_custom_price ? (
                                                <span className="badge bg-success">Priced</span>
                                            ) : (
                                                <span className="badge bg-warning">No Price</span>
                                            )}
                                        </td>
                                        <td>
                                            <Button
                                                size="sm"
                                                variant={property.has_custom_price ? "outline-primary" : "primary"}
                                                onClick={() => handlePriceUpdate(property)}
                                            >
                                                {property.has_custom_price ? 'Update Price' : 'Set Price'}
                                            </Button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </Table>

                        {properties.length === 0 && (
                            <div className="text-center py-5">
                                <h4>No properties available</h4>
                                <p className="text-muted">
                                    Properties will appear here once they are added to the system.
                                </p>
                            </div>
                        )}
                    </Card.Body>
                </Card>

                {/* Price Modal */}
                <PriceModal
                    show={showPriceModal}
                    onHide={() => setShowPriceModal(false)}
                    property={selectedProperty}
                    onSave={handlePriceSave}
                />
            </Container>
        </>
    );
};

export default AgentDashboard;
